INSERT INTO "public"."correo" VALUES ('75', '3', '26', '<p>Hola buen día Diego,</p><br><p>Te adjunto el link de moderador: <span style="line-height: 1.42857; background-color: rgb(245, 245, 245);">http://bbb.salud.gob.sv:8080/AdministradorConferencias/web/moderador.xhtml?id=26&clv=JTAkHL01</span></p><p><span style="line-height: 1.42857; background-color: rgb(245, 245, 245);"><br></span><span style="line-height: 1.42857; background-color: rgb(245, 245, 245);">Saludos</span></p><span style="line-height: 1.42857; background-color: rgb(245, 245, 245);">Exitos en tu día</span>');
INSERT INTO "public"."correo" VALUES ('76', '2', '28', '<p>Muy estimados/as compañeros/as:
</p><p>
Queremos Invitarles a participar en la webconferencia que la Dirección de Desarrollo de Recursos Humanos ha organizado sobre un tema de suma importancia: Conferencia sobre Cancer. 
</p><p>
Se contará con la participación de Manuel Callejas Doctor UES, a quien agradecemos su participación y el tiempo para compartirnos tan importante tema, así como la confianza en este medio para la divulgación de una información de suma relevancia e interés.
</p><p>
Agenda:
</p><p>
Fecha: 2018-07-31
Hora: 08:45 am
Enlace: http://bbb.salud.gob.sv:8080/AdministradorConferencias/web/index.xhtml?id=28&check=516f6bf615fdadfef8cdc9de0650e67087bc528b
Contraseña: J1LRIUNE</p><p>
Requisitos Previos:
</p><p>
1. Abrir el enlace antes indicado.
</p><p>
2. Si utiliza PC de Escritorio o Laptop, sugerimos los navegadores Iceweasel/Firefox o Google Chrome, bajo cualquier sistema operativo, con Adobe Flash instalado y actualizado.
</p><p>
3. En el caso de que prefiera usar teléfonos celulares inteligentes o tabletas, se recomienda que estén conectados vía red inalámbrica y utilizar el navegador Puffin (http://puffin.com).
</p><p>
4. Recomendamos el uso de auriculares con micrófono (diadema), no obstante pueden también utilizar micrófonos integrados y audífonos o parlantes externos.
</p><p>
   En este caso les rogamos mantener silenciado su micrófono exceptuando el momento en el que deseen comunicarse con el/la expositor/a.
</p><p>
5. Puede realizar pruebas previas de funcionamiento de la plataforma en la sala pública, http://bbb.salud.gob.sv
</p>
<br><p>
Información Adicional:
</p><p>
*Para información de las conferencias programadas en el programa {programa} pueden visitar la página de teleconferencias http://www.salud.gob.sv/programacion-de-teleconferencias-telesalud-2016/ , en la que encontrarán toda la programación prevista así como los enlaces para la reproducción de las webconferencias ya realizadas.
</p><p>
*Visitar nuestra Wiki para conocer más sobre el uso de la plataforma BigBlueButton haciendo clic en la siguiente dirección http://wiki.salud.gob.sv/wiki/Manual_BigBlueButton_Participante
</p><br><p>
Muy cordialmente les saludamos,
</p><p>
Viceministerio de Políticas de Salud
</p><p>
Dirección de Desarrollo de Recursos Humanos
</p><p>
Dirección de Tecnologías de Información y Comunicaciones
</p>
<br>
<br><p>
Atte.
</p><p>
Ing. Roberto Soriano
</p><p>
Técnico Informático
</p><p>
DTIC - MINSAL
</p><p>
Email: rsoriano@salud.gob.sv
</p><p>
Teléfono: 2591-7061</p>');
